import React from "react";
import "./style/Thankyou.css"
import Header from "./Header";

function ThankYou (){
    return(
    <div>
        <Header />
        <div className="banner-thankyou">
            <h1>Merci pour votre confiance</h1> <br/>
            <p> A tres biento dans nos locaux</p>
        </div>
    </div>
    )
}
export default ThankYou
